    <div>
      <h6>Visualizar Timeline com:</h6>
      <div>
        <div>
          <Avatar />
          <HeroName />
        </div>

        <div>
          <Avatar />
          <HeroName />
        </div>

        <div>
          <Avatar />
          <HeroName />
        </div>
      </div>
    </div>
  );
}
